(1, '2018-10-25 12:49:28', '0000-00-00 00:00:00', '你是一个跋扈自恣的人吗', '面对跋扈自恣的人，你会怎么做呢？', '生活中，我们遇到那些跋扈自恣的人往往会表现出反感，这类人通常是不懂得该如何尊重别人的，他们看起来很狂妄自大，在生活中并不讨喜。那么你是一个跋扈自恣的人吗？测试一下就知道答案了，下面我们就一起来做个性格测试吧！面对跋扈自恣的人，你会怎么做呢？A、直接无视\n\n　　B、嘲笑\n\n　　C、偷偷观察\n\n　　D、顺从\n测试答案：\n\n　　A、你是一个跋扈自恣的人\n　　你在生活中是一个为所欲为的人，你觉得自己最大，你想做什么就去做什么，别人对你的劝告对你完全起不来作用。你的性格很孤僻，只会听从自己的心去做事情，身边的人觉得你经常一副目中无人的样子。因此，你是一个跋扈自恣的人。\n\n　　B、你很大可能是一个跋扈自恣的人\n　　你在生活中经常肆无忌惮的去做自己想做的事情，你做事带着冲动，很多时候你并没有考虑到自己的行为会有什么样子的后果。你并不是一个懂得体谅和关心别人的人，你把自己当成了生活的主角，因此，你很大可能是一个跋扈自恣的人。\n\n　　C、你很小可能是一个跋扈自恣的人\n　　你在生活中是一个胆小怕事的人，你是小心翼翼的过着自己的生活，你很害怕惹麻烦，你觉得以自己的能力更不处理不了麻烦。很多时候你希望生活能够越平静是越好的，你并不想生活出现风浪。因此，你很小可能是一个跋扈自恣的人。\n\n　　D、你不是一个跋扈自恣的人\n　　你是一个在生活中表现得很低调的人，你懂得尊重生活，并且遵守生活中的一些规则。身边的人觉得你是很老实听话的人，和你相处并不是难事，你懂得去体谅别人，并且适时的为了别人做一些让步。因此，你不是一个跋扈自恣的人。\n第一星座网原创文章，转载请联系网站管理人员，否则视为侵权。（若有侵权，请联系管理员删除！）', 'https://img.d1xz.net/d/2018/08/5b6a62aa221c2.jpg', 10, 1),
(2, '2018-10-23 10:02:15', '0000-00-00 00:00:00', '你离婚后还能遇见真爱吗', '离婚之后你是不是不能独立生活呢？', '离婚一般都是无奈之举，不到万不得已的时候大部分人是不会选择离婚的，不过既然已经离婚，大部分人也会欣然接受自己崭新的生活的，离婚后还是需要努力生活的。那么你离婚后还能遇见真爱吗？测试一下就知道答案了，下面我们就一起来做个婚姻测试吧。1、离婚之后你是不是不能独立生活呢？6、你是不是觉得离婚是万不得已的呢？测试答案：A、你离婚后还能遇见真爱离婚对你虽然有打击，但是也让你好好的反省了一番，离婚之后你还能遇到真爱的，你觉得自己更加懂得该如何去爱别人和爱自己了。离婚并没有影响你的正常生活，对你来说离婚是新生活的开心，你会因为摆脱了不对的人而变得更加的自信，生活越来越好。　B、你离婚后不知道怎么去爱离婚对你又太多的打击，你已经失去了爱人的能力了，离婚之后你会有很长的一段时间陷入深深的伤痛中。爱情是你不敢提及的事情，怎么再去爱你也没有想过，你只想让自己走出伤痛，好好生活，你心里很害怕自己会失去独立生活的能力，你并不能遇到真爱。C、你离婚后对爱情没有兴趣了离婚之后你就不想再去谈感情了，你觉得一次失败的婚姻给了自己太多的教训，你不想在去经历那些曾经经历过的伤害。爱情在你看来变成了一件很无趣的事情，你对爱情完全没有了兴趣，即使再婚你也很难因为爱情了，你觉得生活除了爱情还有很多东西。D、你离婚后不再注重感情离婚对你来说是一件很重大的事情，你离婚后就不会把自己的重心放在感情上，你觉得被婚姻束缚了太久，你有太多想做的事情没能去做。离婚之后你会完全放飞自我，自己想做什么就会去做什么，你觉得自己自由了，该把时间放在自己想做的事情上了。第一星座网原创文章，转载请联系网站管理人员，否则视为侵权。（若有侵权，请联系管理员删除！）', 'https://img.d1xz.net/d/2018/08/5b763059e6717.jpg', 1, 1),
(3, '2018-10-23 10:05:40', '0000-00-00 00:00:00', '测你是哪个品种的喵星人', '你是哪个品种的喵星人呢？', '养猫在现在的生活中是越来越受年轻人的喜欢了，猫并没有狗那么黏人，照顾起来也会方便一些，人也不会感觉那么的孤单了，猫是很可爱的动物。那么你是哪个品种的喵星人？测试一下就知道答案了，下面我们就一起来做个趣味测试吧。1、你会不会养猫呢？会的→2\n　　不会的→4\n　　看情况→3\n\n　　2、猫在你看来是不是温柔的动物呢？\n　　是的→4\n　　不是的→3\n　　不好说→6\n\n　　3、你被猫抓伤的时候会不会恐惧呢？\n　　特别恐惧→4\n　　不恐惧→7\n　　看情况→5\n\n　　4、你是不是看到猫就很排斥的人呢？\n　　超级排斥→6\n　　不排斥→7\n　　看情况→8\n\n　　5、养猫你最害怕的是什么呢？\n　　猫掉毛→7\n　　猫咬人→8\n　　猫太吵→6\n6、你是不是什么动物都不喜欢的人呢？\n　　是的，一点都不喜欢→9\n　　不是的，都很喜欢→7\n　　不好说→10\n\n　　7、在你看来，喜欢动物的人是不是很有爱心呢？\n　　是的→8\n　　不是的→10\n　　不好说→9\n\n　　8、你的家人会因为什么反对你养猫呢？\n　　怕脏→9\n　　怕吵→C\n　　怕浪费钱→10\n\n　　9、你是不是会用心样宠物的人呢？\n　　是的→B\n　　不是的→D\n　　看情况→10\n\n　　10、你是不是只会养自己的人呢？\n　　是的→A\n　　不是的→B\n　　看情况→C\n测试答案：\n\n　　A、你是埃及猫\n　　埃及猫聪明、敏锐，身上带着一种激情和速度，它们天性好动，喜欢户外生活，并不容易被环境所拘束着，它们有敏锐的警惕性，自己的领域不容被他人侵犯。你在生活中是一个很喜欢自由的人，你喜欢埃及猫身上的性格，你对自己身边的人环境也充满了警惕性。\n\n　　B、你是苏格兰折耳猫\n　　苏格兰折耳猫是非常恋家的猫，它们平易近人，并不具备攻击性，它们也很聪明，对自己的主人很忠诚，只有在猎物面前才会表现出攻击性来。你在生活中是一个很注重家庭的人，你和苏格兰折耳猫一样都恋家，你看起来很有亲和力，因此有很多的朋友。\n\n　　C、你是布偶猫\n　　布偶猫是很安静温柔的，它们特别的黏人，会主动的去亲近自己的主人，养布偶猫的时候会感觉自己一点不孤单，它们都任何人都很友善，身上一点攻击力都没有。你在生活中是一个不喜欢热闹的人，你对自己喜欢的人很主动，但是对别人却常常表现出冷漠来。\n\n　　D、你是波斯猫\n　　波斯猫属于猫中的贵族，有很强的适应能力和很高的警惕性，它们也很黏人，但是主人在做事情的时候它们并不会去打扰，而是选择安静的陪伴，即使内心孤单。你在生活中是一个低调的人，你并不会因为自己的能力而轻视别人，你很像波斯猫一样会去尊重别人。\n\n第一星座网原创文章，转载请联系网站管理人员，否则视为侵权。（若有侵权，请联系管理员删除！）', 'https://img.d1xz.net/d/2018/08/5b83631076946.jpg', 3, 1),
(4, '2018-10-25 10:23:03', '0000-00-00 00:00:00', '情感类2222', '你离婚后，22222？', '生活中，我们遇到那些跋扈自恣的人往往会表现出反感，这类人通常是不懂得该如何尊重别人的，他们看起来很狂妄自大，在生活中并不讨喜。那么你是一个跋扈自恣的人吗？测试一下就知道答案了，下面我们就一起来做个性格测试吧！面对跋扈自恣的人，你会怎么做呢？', 'http://img4.imgtn.bdimg.com/it/u=1878770333,4043213811&fm=26&gp=0.jpg', 1, 0),
